import React from 'react'
import '../profesor.css'
import '../button.css'
import '../formulario.css'
import { Link } from 'react-router-dom';

class Profesor extends React.Component {
    render() {
        return (
            <div className="container">
                <h2>Bienvenido al Menu Profesor</h2>
                <form class="form">
                    <h2>Iniciar Sesi칩n</h2>
                    <p type="Usuario:"><input placeholder="Write your name here.."></input></p>
                    <p type="Contrase침a"><input type="password" placeholder="Introduzca su contrase침a..."></input></p>
                    <button>Iniciar Sesi칩n</button>
                    <div className="formdiv">
                        <span class="fa fa-phone"></span>001 1023 567
                        <span class="fa fa-envelope-o"></span> contact@company.com
                    </div>
                </form>
                <br/><br/>
                <Link to="/sistematt"><href className="myButton">Log Out</href></Link>
            </div>
        );
    }
}

export default Profesor;
